.sign-in-container {
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    width: 100%;
    background-color: #f1f1f1;
}

.sign-in-body {
    padding: 30px;
    width: 400px;
    height: 100%;
}

.sign-in-title {
    padding-bottom: 30px;
    text-align: center;
    font-weight: 600;
    font-size: 20px;
    color: #409EFF;
}

.sign-in-input {
    margin-bottom: 20px;
}
.sign-in-submit{
    display: flex;
    justify-content: center;
}
.login-container{
    padding: 0 10px;
}
.login-text{
    color: #409EFF;
    font-size: 16px;
    cursor:pointer;
}
